import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Vol_Data() {
  const [srno, setSrno] = useState('');
  const [volunteerData, setVolunteerData] = useState(null);

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3001/get-volunteer', { srno });
      setVolunteerData(response.data);
    } catch (error) {
      console.error('Error fetching volunteer data:', error);
    }
  };

  useEffect(() => {
    const fetchVolunteerData = async () => {
      try {
        const response = await axios.post('/get-volunteer', { srno });
        setVolunteerData(response.data);
      } catch (error) {
        console.error('Error fetching volunteer data:', error);
      }
    };

    if (srno) {
      fetchVolunteerData();
    }
  }, [srno]);

  return (
    <div>
      <h1 id="title">Volunteer Information</h1>
      <form className="form" onSubmit={handleFormSubmit}>
        <label htmlFor="srno">Enter Serial Number:</label>
        <input
          type="text"
          id="srno"
          name="srno"
          required
          value={srno}
          onChange={(e) => setSrno(e.target.value)}
        />
        <button type="submit" id="btn">Submit</button>
      </form>

      {volunteerData && (
        <div>
          <table border="1">
            <thead>
              <tr>
                <th>Serial Number</th>
                <th>Name</th>
                <th>VEC Number</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{volunteerData.srno}</td>
                <td>{volunteerData.name}</td>
                <td>{volunteerData.vecno}</td>
              </tr>
            </tbody>
          </table>

          {Object.entries(volunteerData.eventsByCategory).map(([category, events]) => (
            <div key={category}>
              <h2>{category}</h2>
              <table border="1">
                <thead>
                  <tr>
                    <th>Event Name</th>
                    <th>Date</th>
                    <th>Hours Allotted</th>
                  </tr>
                </thead>
                <tbody>
                  {events.map((event) => (
                    <tr key={event.eventname}>
                      <td>{event.eventname}</td>
                      <td>{event.date ? new Date(event.date).toLocaleDateString() : 'No Date Available'}</td>
                      <td>{parseInt(event.hoursallotted, 10) || 0}</td>
                    </tr>
                  ))}

                  {/* Calculate and display the total hours for the category */}
                  <tr>
                    <td colSpan="2">
                      <strong>Total</strong>
                    </td>
                    <td>
                      {events.reduce((total, event) => total + (parseInt(event.hoursallotted, 10) || 0), 0)}
                    </td>
                  </tr>
                </tbody>
              </table>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default Vol_Data;
